INSERT INTO `edu_course` VALUES (28, '神经网络与深度学习', 'enable', '人工智能不再准备有一天改变世界，它正在改变世界。 神经网络与深度学习，是这一轮人工智能热潮中的主角，它不仅改变了计算领域，也为其他学科和领域提供了强大新工具。现代社会，迫切需要人工智能和专业知识交叉融合的复合型人才，任何专业的学生，都需要掌握一些人工智能的知识。 面对人工智能庞杂的分支领域，海量的学习资源，陡峭的学习曲线，你是否也曾感觉无从下手，不知道应该从何学起？是否也曾经历过 “从入门到放弃” 的艰涩历程...... 我们力求打造一门 “低门槛，高标准” 的课程，面向多学科背景、多层次的学习者，以简洁易懂，又层层深入的方式，帮助初学者轻松而扎实的踏上人工智能的第一道门槛，引领大家 “无痛” 的进入人工智能的领域，实现从0到1的突破。', 61, '2023-09-28 17:56:48', '2023-09-28 17:59:09');
INSERT INTO `edu_course` VALUES (29, '计算机网络与通信技术', 'enable', '本课程以谢希仁老师的《计算机网络》为教材，采用随堂录制和录音棚录制两种方式满足同学们不同的学习习惯，本次开课加入了三个重要实验，实验均可在线完成。本课程是是为学习、设计、管理和构建强大的通信应用系统而设置的重要专业课程，是计算机科学、网络工程、软件工程及其相关专业的专业必修课程之一，也是非计算机类工科专业的核心课程之一。通过本门课程的学习，可以系统地建立计算机网络通信的理论体系，掌握计算机网络的体系结构及数据通信的基本原理，并经进一步学习能将所学知识应用于其他类型的通信网络。课程以计算机网络体系结构为纲组织内容，比较全面地介绍了计算机网络各层次的工作原理，主要包括计算机网络的协议与体系结构、物理层及数据通信基础、数据链路控制协议、网络层路由算法、运输层原理及可靠性传输的实现方法、网络的主要应用等，此外还介绍了网络技术的一些最新成果与应用。为今后现场总线与工业控制、专业综合设计以及数据通信与控制网络等课程奠定基础。', 61, '2023-09-28 17:57:35', '2023-09-28 17:59:06');
INSERT INTO `edu_course` VALUES (30, '东亚文化视野下的日本语言文学', 'enable', '《东亚文化视野下的日本语言文学》为专业人文类课程，旨在通过课程的讲解，梳理中日语言与文化的交流历史，使学生对日本的语言以及语言背后的文化有一个较为系统与专业的感知，通过了解日本，重新审视中国文化，加深对自身文化的理解与认同。', 61, '2023-09-28 17:58:54', '2023-11-02 20:22:54');
INSERT INTO `edu_course` VALUES (31, '备考雅思，冲压冲鸭！！！！', 'enable', '备考雅思，冲压冲鸭！！！！', 61, '2023-09-28 23:44:55', '2023-09-28 23:45:04');
